import React from "react";
import data from "./data";

const numberOfBirthDays = data.length;
const List = () => {
  return (
    <>
      <h2>{`${numberOfBirthDays} Birthdays Today`} </h2>
      {console.log(numberOfBirthDays)}
    </>
  );
};

export default List;
